import React ,{ useState } from 'react'
import axios from 'axios';

export default function Admin() {

    const [productpg, setProductpg] = useState(false);
    const [userpg, setUserpg] = useState(false);
    const [pname,setPname]=useState();
    const [pdec,setPdec]=useState();
    const [pprice,setPprice]=useState();
    const [pcato,setPcato]=useState();
    const [pim,setPim]=useState();
    const [pimi,setPimi]=useState();
    const [pimii,setPimii]=useState();
    const [pimiii,setPimiii]=useState();
    const [psale, setPsale] = useState(false);
    const [pfea, setPfea] = useState(false);
    const [pdis,setPdis]=useState();

    const productchange =()=>{
        setProductpg(true)
        setUserpg(false)
    }

    const userchange =()=>{
        setProductpg(false)
        setUserpg(true)
    }

    const client = axios.create({
        baseURL: 'http://127.0.0.1:8000',
      });
      const data ={
        "name": pname,
    "price": pprice,
    "dec": pdec,
    "image": pim,
    "imageone": pimi,
    "imagetwo": pimii,
    "imagethree": pimiii,
    "cato": pcato,
    "sale": psale,
    "discount": pdis,
    }

    const handleProductpost =()=>{
        
        console.log('dtataa',data);
        client.post('/api/product/', data)
  .then(response => {
  })
  .catch(error => {
  });
    }
    
    return(
        <>  
        <div className='nav'>
            <div className='container'>
                <h1>Admin Page</h1>

            </div>
            <div className='main-cols'>
                <button onClick={ productchange}>Product</button>
                <button onClick={ userchange}>User</button>
            </div>
        </div>
        <div className='main'>
        {productpg &&(<><form className='ad-form'>
                <div className='admin-lab'>
                    <h2>Product Name</h2>
                    <input placeholder='item name' value={pname} onChange={(e) => setPname(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Product Dec</h2>
                    <input placeholder='item dec'  value={pdec} onChange={(e) => setPdec(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Product Price</h2>
                    <input placeholder='item price' value={pprice} onChange={(e) => setPprice(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Product Cato</h2>
                    <input placeholder='item Cato' value={pcato} onChange={(e) => setPcato(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Product Image 1</h2>
                    <input type="text" placeholder='itemimage' value={pim} onChange={(e) => setPim(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Product Image 2</h2>
                    <input type="text" placeholder='itemimage' value={pimi} onChange={(e) => setPimi(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Product Image 3</h2>
                    <input type="text" placeholder='itemimage' value={pimii} onChange={(e) => setPimii(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Product Image 4</h2>
                    <input type="text" placeholder='itemimage' value={pimiii} onChange={(e) => setPimiii(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Sale</h2>
                    <input type="checkbox"    value={psale} onChange={(e) => setPsale(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Featured</h2>
                    <input type="checkbox"   value={pfea} onChange={(e) => setPfea(e.target.value)}/>
                </div>
                <div className='admin-lab'>
                    <h2>Discount</h2>
                    <input type="text"   value={pdis} onChange={(e) => setPdis(e.target.value)}/>
                </div>
                <button onChange={handleProductpost}>add</button>
            </form></>) }
            {userpg &&(
                <><form className='ad-form'>
                <div className='admin-lab'>
                    <h2>User Name</h2>
                    <input placeholder='item name'/>
                </div>
               
                
                <div className='admin-lab'>
                    <h2>Staff</h2>
                    <input type="checkbox"   />
                </div>
                
                
            </form></>
            )}
        </div>
        </>
    )
}
